import React, { useState } from "react";
import { List } from "antd";

export const TodoList = (props) => {
  const { text, maxRow } = props;
  const [show, setShow] = useState(!!text || false);
  const onClick = () => {
    console.log(maxRow);
    setShow(false);
  };
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div>{text}</div>
      <List />
      {show && <button onClick={onClick}>展开</button>}
    </div>
  );
};
